      out.write("\t\t\t\t<div class=\"container content privacy-container\">\r\n");
      out.write("\t\t\t\t\t<div class=\"row privacy-title\">关于我们</div>\r\n");
      out.write("\t\t\t\t\t<div class=\"row privacy-row\">\r\n");
      out.write("\t\t\t\t\t\t<h3 class=\"privacy-h3\">平台简介</h3>\r\n");
      out.write("\t\t\t\t\t\t<p>通过经营综合性互联网教育平台，我们向广大用户提供着覆盖种类多元化，具备高度互动特质的优秀互联网教育产品及服务，并以此展示了我们先进的互联网技术和对教育行业的透彻理解。</p>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h3 class=\"privacy-h3\">业务体系</h3>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<p>作为于提供互联网教育产品及服务，我们专注于开发可促进学习及改善学习表现的重要技术工具、媒介、程序及数据资源。尤其是，我们已成功开发我们自有的智能学习系统，该系统包含相互嵌合，且完善兼容的一系列技术或功能模块。整体而言，该等项目可有效将互联网技术改造应用在教师及学员于学习及认知过程中经历的各个场景，包括「教、学、练、测」。于管理自有品牌课程业务分部时，除采用该系统外，我们亦促使在我们平台注册的相关商户或自雇网师使用该平台上提供的功能，作为我们技术服务的一部份。</p>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<h3 class=\"privacy-h3\">特色班块</h3>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<p> e享课堂笔记功能为视频学习做了专门设计。学习者添加笔记 时会自动保存视频的当前时间点，回顾笔记时就可观看当时 视频。学习者还可以对视频截图或上传本地图片保存到笔记 当中， 使得保存老师的板书、重要信息更快捷。学习者可将 笔记公开，也可评论、收藏他人笔记，加强了用户间学习交 流。用户还可以给网络教学视频课程评分来决定教学视频的 质量。</p>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t<p>系列课程</p>\r\n");
      out.write("\t\t\t\t\t\t<p>将某一领域的内容进行打包并有序地呈现，给用户提供完整 的、有体系的学习方案。解决用户有计划学习某项技能，但 是又不知道应该如何开始学起的问题，同时能够让学员快 速、全面地掌握相关知识点。 进度管理与学习监督 e享课堂更关注用户个人学习的效率和效果。学习者学习过程 中，e享课堂支持自动\\手动标记课时完成状态，或标记为“重 要\\有疑问”等，以便用户回顾和把控学习进度。另外，用 户可设置课程的学习时间安排，e享课堂会定期发送提醒通知用户。</p>\r\n");
      out.write("\t\t\t\t\t\t<p>帮助中心</p>\r\n");
      out.write("\t\t\t\t\t\t<p>我怎样才能注册登录 e享课堂？ 您可以使用邮箱帐号登录 e享课堂。如果您还没有邮箱，您可以注册邮箱，注册成功后登录至 e享课堂。 为什么用电脑访问 e享课堂时视频无法播放？ 当您使用电脑访问 e享课堂时： − 支持浏览器 Chrome10.0+、FireFox4.0+、IE7.0+版本； − 必须安装 flash10+版本 我可以在 e享课堂中开设自己的课程吗？ 还有其他问题的话登录 xx网站进行查询或拨打电话或通过 微信公众号进行查询。</p>\r\n");
      out.write("\t\t\t\t\t\t<p>退款规则</p>\r\n");
      out.write("\t\t\t\t\t\t<p>1、非微专业课程： A、用户购买课程之日起 7天内非平台（即网易云课堂， 下同）技术原因不予退款。平台技术原因是指：由平 台技术故障引发的连续超过 24小时课程无法正常观 看、视频无法正常播放、PPT/PDF课程无法观看。如用户个人网络原因、观看设备故障、用户账号丢失等 类原因不属于平台技术故障。 B、用户购买超过 7天后一律不予退款。</p>\r\n");
